-- curso
INSERT INTO curso VALUES (1,1,NULL,NULL,'2022-08-26 23:06:49','Com duracao de cinco anos, forma o profissional para atuar na area, realizando, entre outras atividades: analise, planejamento e desenvolvimento de sistemas computacionais centralizados e distribuídos, sistemas embarcados, desenvolvimento e uso de tecnologias de comunicacao, sistemas multimídia e hipermídia, redes de computadores, bem como gestao de sistemas industriais e comerciais e de empresas de computacao.','https://univesp.br/sites/58f6506869226e9479d38201/assets/5e1f6be47c1bd13d86e1ce59/Licenciatura_em_Letras.pdf','https://apps.univesp.br/manual-do-aluno/assets/PPC/matematica/PPC_CURSO%20DE%20LICENCIATURA%20EM%20%20LETRAS,%20MATEMaTICA%20E%20PEDAGOGIA%20-%202020.pdf','Licenciatura em Letras','LL',1),(2,1,NULL,NULL,'2022-08-26 23:06:49','Forma o profissional para atuar em instituicões educativas, na Educacao Infantil, nos anos iniciais do Ensino Fundamental, nas disciplinas pedagó- gicas de cursos de formacao em nível médio e na Educacao Especial e na gestao pedagógica e educacional. Além disso, também qualifica o profissional para a atuar em instituicões nao-escolares e nao formais.','https://univesp.br/sites/58f6506869226e9479d38201/assets/5e1f6b877c1bd1571deb64cf/Pedagogia.pdf','https://apps.univesp.br/manual-do-aluno/assets/PPC/matematica/PPC_CURSO%20DE%20LICENCIATURA%20EM%20%20LETRAS,%20MATEMaTICA%20E%20PEDAGOGIA%20-%202020.pdf','Licenciatura em Pedagogia','LP',1),(3,1,NULL,NULL,'2022-08-26 23:06:49','Forma o profissional para ministrar aulas nas séries finais do ensino fundamental, no ensino médio e nos cursos técnicos deste nível de ensino, produzir objetos de aprendizagem com conteúdo matematico e atuar em editoras de livros didaticos, entre outras atividades.','https://univesp.br/sites/58f6506869226e9479d38201/assets/5e1f6c157c1bd1571deb64d4/Licenciatura_em_Matem_tica.pdf','https://apps.univesp.br/manual-do-aluno/assets/PPC/matematica/PPC_CURSO%20DE%20LICENCIATURA%20EM%20%20LETRAS,%20MATEMaTICA%20E%20PEDAGOGIA%20-%202020.pdf','Licenciatura em Matematica','LM',1),(4,0,NULL,NULL,'2022-08-26 23:06:49','Formacao de profissional capaz de atuar em um mundo em profundas e aceleradas mudancas econômicas, sociais e culturais e com sólida instrucao técnico-pratica e metodológica, fundamentada nos conhecimentos técnicos da Física, no entendimento pedagógico e na vivencia de experiencias relativas ao ensino, qualidades imprescindíveis a um educador.','https://univesp.br/sites/58f6506869226e9479d38201/assets/5953f82c69226e48bd34ec6d/Licenciatura_em_F_sicaFINAL.pdf',NULL,'Licenciatura em Física','LF',1),(5,0,NULL,NULL,'2022-08-26 23:06:49','Formacao de profissional capaz de atuar em um mundo em profundas e aceleradas mudancas econômicas, sociais e culturais e com sólida instrucao técnico-pratica e metodológica, fundamentada nos conhecimentos técnicos da Química, no entendimento pedagógico e na vivencia de experiencias relativas ao ensino, qualidades imprescindíveis a um educador.','Com duracao de quatro anos, o curso prepara o cientista para trabalhar ferramentas matematicas, estatísticas e computacionais voltadas a auxiliar no processo de extracao de conhecimentos a partir de dados, que auxiliam nas tomadas de decisões.  ',NULL,'Licenciatura em Química','LQ',1),(6,0,NULL,NULL,'2022-08-26 23:06:49','Formacao de profissional capaz de atuar em um mundo em profundas e aceleradas mudancas econômicas, sociais e culturais e com sólida instrucao técnico-pratica e metodológica, fundamentada nos conhecimentos técnicos da Biologia, no entendimento pedagógico e na vivencia de experiencias relativas ao ensino, qualidades imprescindíveis a um educador.','Formacao de profissional capaz de atuar em um mundo em profundas e aceleradas mudancas econômicas, sociais e culturais e com sólida instrucao técnico-pratica e metodológica, fundamentada nos conhecimentos técnicos da Biologia, no entendimento pedagógico e na vivencia de experiencias relativas ao ensino, qualidades imprescindíveis a um educador.',NULL,'Licenciatura em Biologia','LB',1),(7,1,NULL,NULL,'2022-08-26 23:06:49','Com duracao de cinco anos, forma o profissional para atuar na area, realizando, entre outras atividades: analise, planejamento e desenvolvimento de sistemas computacionais centralizados e distribuídos, sistemas embarcados, desenvolvimento e uso de tecnologias de comunicacao, sistemas multimídia e hipermídia, redes de computadores, bem como gestao de sistemas industriais e comerciais e de empresas de computacao.','https://univesp.br/sites/58f6506869226e9479d38201/assets/5db214307c1bd15cf783c6c9/EC.pdf','https://apps.univesp.br/manual-do-aluno/assets/PPC/engenharia-da-computacao/PPC-BTI.pdf','Engenharia de Computacao','EC',2),(8,1,NULL,NULL,'2022-08-26 23:06:49','Com duracao de tres anos, o curso prepara o estudante para o desenvolvimento de solucões que envolvem software, web, nuvem e mobile.','https://univesp.br/sites/58f6506869226e9479d38201/assets/5db215497c1bd15c6efb0394/BTI.pdf','https://apps.univesp.br/manual-do-aluno/assets/PPC/engenharia-da-computacao/PPC-BTI.pdf','Bacharelado Tecnologia da Informacao','BTI',2),(9,1,NULL,NULL,'2022-08-26 23:06:49','Com duracao de quatro anos, o curso prepara o cientista para trabalhar ferramentas matematicas, estatísticas e computacionais voltadas a auxiliar no processo de extracao de conhecimentos a partir de dados, que auxiliam nas tomadas de decisões.  ','https://univesp.br/sites/58f6506869226e9479d38201/assets/5db214c77c1bd15cf783c6ce/Ci_ncia_de_Dados.pdf','https://apps.univesp.br/manual-do-aluno/assets/PPC/engenharia-da-computacao/PPC-BTI.pdf','Bacharelado em Ciencia de Dados','BCD',2),(10,1,NULL,NULL,'2022-08-26 23:06:49','Forma profissionais qualificados para gerir organizacões, conduzir equipes e gerar inovacões. Tem como funcões fundamentais planejar, dirigir, organizar e controlar. A formacao do Administrador transita pelo ecletismo dos conhecimentos, pela multiplicidade de areas que auxiliam na construcao da formacao desse profissional.  ','https://univesp.br/sites/58f6506869226e9479d38201/assets/62268faf7c1bd15db29945fb/Adm.pdf',NULL,'Bacharelado em Administracao','BA',3),(11,1,NULL,NULL,'2022-08-26 23:06:49','Forma o profissional para o desenvolvimento de solucões que busquem otimizar os recursos de uma organizacao, propondo melhorias e promovendo uma mudanca organizacional planejada. Sua atuacao inclui planejar, projetar, gerenciar e promover os processos organizacionais e os sistemas da organizacao, sejam elas','https://univesp.br/sites/58f6506869226e9479d38201/assets/621406d97c1bd15f67e72b69/Tecn_logo_em_Processos_Gerenciais.pdf',NULL,'Tecnologia em Processos Gerenciais','TPC',3),(12,0,NULL,NULL,'2022-08-26 23:06:49','Forma o profissional para planejar, implementar, supervisionar e avaliar projetos e programas de políticas públicas voltados para o desenvolvimento local e regional. Prepara, também, esse profissional para aplicar metodologias inovadoras de gestao, baseadas nos princípios de administracao pública, legislacao, tecnologias gerenciais, aspectos ambientais e ética profissional e para avaliar e emitir parecer técnico em sua area de formacao.','https://apps.univesp.br/manual-do-aluno/assets/matriz/matriz_gp.pdf','https://apps.univesp.br/manual-do-aluno/assets/PPC/gestao-publica/PPC%20Gestao%20Pública%20Versao%20Final%20%20-%20REVISADO.pdf','Tecnologia em Gestao Pública','TGP',3),(13,1,NULL,NULL,'2022-08-26 23:06:49','Forma o profissional capaz de observar os processos organizacionais com visao sistemica e integrada, de analisar e de propor solucões para questões complexas, reunindo competencias que integrem formacao tecnológica em Engenharia de Producao, com a formacao humanística além da necessaria instrumentacao numérica, quantitativa e computacional, mas sempre observando o desenvolvimento sustentavel das organizacões.','https://univesp.br/sites/58f6506869226e9479d38201/assets/621406d97c1bd15f67e72b6a/Bacharel_em_Engenharia_de_Produ__o.pdf','https://apps.univesp.br/manual-do-aluno/assets/PPC/engenharia-de-producao/PPC_Engenharia_Producao%20-%202014-%2016%20-%20REVISADO.pdf','Engenharia de Producao','EP',3);

